(function () {
  'use strict';

  // Campanas controller
  angular
    .module('campanas')
    .controller('CampanasPiezasController', CampanasPiezasController);

  CampanasPiezasController.$inject = ['$scope', '$state', '$window', 'Authentication', 'campanaResolve'];

  function CampanasPiezasController ($scope, $state, $window, Authentication, campana) {
    var vm = this;

    vm.authentication = Authentication;
    vm.campana = campana;

    $("#btn-pdf").click(function(){

        function getTable(piezas){

          var table = [];
          var headers = [ {text: 'Código', style: 'tableHeader'},
                          {text: 'Descripción', style: 'tableHeader'},
                          {text: 'Material', style: 'tableHeader'},
                          {text: 'Latitud', style: 'tableHeader'},
                          {text: 'Longitud', style: 'tableHeader'}
                        ]

          table.push(headers);
          for (var p in piezas){
            var v = piezas[p];
            table.push([v.codigo, 
                        v.descripcion.toUpperCase(), 
                        v.material.toUpperCase(), 
                        Number(v.latitud).toFixed(6), 
                        Number(v.longitud).toFixed(6)
                      ]);
          }


          console.log(table);
          return table;
        }

        console.log("hola mundo");
        var dd = {
          content: [
            {
              image: 'data:image/png;base64,',
              width: 100
            },
            { 
              stack: [
                'Informe de Campaña',
                { text: vm.campana.name, style: 'subheader' },
              ],
              style: 'header'
            },
            { 
              fontSize: 20, 
              text: [
                'Información General',
              ],
              margin: [0, 10]
            },
            { 
              text: [
                { text: 'Responsable: ', italics: true, bold: true }, vm.campana.responsable
              ],
              margin: [0, 10]
            },
            { 
              text: [
                { text: 'Ubicación: ', italics: true, bold: true }, 
              ],
              margin: [0, 10]
            },
            {
              text: 'Latitud: ' + vm.campana.latitud,
              margin: [20, 0],
            },
            {
              text: 'Longitud: ' + vm.campana.longitud,
              margin: [20, 0],
            },
            { 
              text: [
                { text: 'Motivo: ', italics: true, bold: true }, vm.campana.motivo
              ],
              margin: [0, 10]
            },
            { 
              fontSize: 20, 
              text: [
                'Piezas',
              ],
              margin: [0, 10]
            },
            {
              style: 'tableExample',
              table: {
                width: 'auto',
                headerRows: 1,
                body: getTable(vm.campana.piezas)
              },
              layout: 'headerLineOnly'
            },
          ],
            styles: {
              header: {
                fontSize: 18,
                bold: true,
                alignment: 'right',
                margin: [0,0,0,80]    
              },
              subheader: {
                fontSize: 14
              },
              superMargin: {
                margin: [20, 0, 40, 0],
                fontSize: 15,
              }
            }
        }

        pdfMake.createPdf(dd).open();
    });

  }
}());
